const Images = {
  portfolio: {
    portfolio00: require("./portfolio00.jpg").default,
    portfolio01: require("./portfolio01.jpg").default,
    portfolio02: require("./portfolio02.jpg").default,
  },

  profile: {
    profile00: require("./images/profile00.jpg").default,
    profile01: require("./images/profile01.jpg").default,
  },

  services: require("./images/services.jpg").default,
}

export default Images
